import 'bootstrap/dist/css/bootstrap.min.css';
import {Add} from './Add.js';
import {Home} from './Home.js';
export class MS extends React.Component {
    render(){
    return (

      <div className="App">
        <div>
        <nav class="navbar navbar-light bg-light">
                      <div class="container-fluid">
                           <a class="navbar-brand">
                               <img src="https://m.media-amazon.com/images/I/41MOEFEt3eL._AC_.jpg" alt="" width="30" height="24" class="d-inline-block align-text-top"/>
                                   Dheeraj
                           </a>
                      </div>
        </nav>
        </div>
        <div>
         <Home/>
        </div>
        <div>
          <Add/>
        </div>
       <div>
       <a class="btn btn-primary stretched-link" href="/News">Click here to view Trendy Newz</a>

       </div>
      </div>

    );
  }
}

  export default MS;
